import React from 'react';
import { Link } from 'react-router-dom'
import './Home.css';

function Home()
{
    return (
        <div className="container1"> {/* Apply the container class */}
          <Link to="/Main" className="button">
            Customer details
          </Link>
          <Link to="" className="button">
            Contact details
          </Link>
        </div>
      );
}
export default Home;
